import React, { useState, useRef } from 'react';
import {
  Box,
  Card,
  CardContent,
  Button,
  Typography,
  LinearProgress,
  List,
  ListItem,
  ListItemText,
  ListItemSecondaryAction,
  IconButton,
  Alert,
  TextField,
} from '@mui/material';
import {
  CloudUpload as UploadIcon,
  CloudDownload as DownloadIcon,
  Delete as DeleteIcon,
} from '@mui/icons-material';
import axios from 'axios';

const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:3000';

interface FileTransferLog {
  timestamp: Date;
  fileName: string;
  type: 'upload' | 'download';
  status: 'success' | 'error';
}

const FileTransfer: React.FC = () => {
  const [deviceToken, setDeviceToken] = useState('');
  const [uploading, setUploading] = useState(false);
  const [downloadFileName, setDownloadFileName] = useState('');
  const [transferLogs, setTransferLogs] = useState<FileTransferLog[]>([]);
  const [error, setError] = useState<string>('');
  const fileInputRef = useRef<HTMLInputElement>(null);

  const handleFileUpload = async (event: React.ChangeEvent<HTMLInputElement>) => {
    const file = event.target.files?.[0];
    if (!file || !deviceToken) return;

    setError('');
    setUploading(true);

    try {
      const formData = new FormData();
      formData.append('file', file);
      formData.append('token', deviceToken);

      const response = await axios.post(`${API_URL}/api/upload`, formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
      });

      setTransferLogs((prev) => [
        {
          timestamp: new Date(),
          fileName: file.name,
          type: 'upload',
          status: response.data.success ? 'success' : 'error',
        },
        ...prev,
      ]);

      // Clear the file input
      if (fileInputRef.current) {
        fileInputRef.current.value = '';
      }
    } catch (err) {
      setError('Failed to upload file. Please try again.');
      console.error(err);
    } finally {
      setUploading(false);
    }
  };

  const handleFileDownload = async () => {
    if (!downloadFileName || !deviceToken) return;

    setError('');
    try {
      const response = await axios.get(
        `${API_URL}/api/download/${downloadFileName}`,
        {
          params: { token: deviceToken },
          responseType: 'blob',
        }
      );

      // Create download link
      const url = window.URL.createObjectURL(new Blob([response.data]));
      const link = document.createElement('a');
      link.href = url;
      link.setAttribute('download', downloadFileName);
      document.body.appendChild(link);
      link.click();
      link.remove();

      setTransferLogs((prev) => [
        {
          timestamp: new Date(),
          fileName: downloadFileName,
          type: 'download',
          status: 'success',
        },
        ...prev,
      ]);

      setDownloadFileName('');
    } catch (err) {
      setError('Failed to download file. Please check the file name and try again.');
      console.error(err);
    }
  };

  return (
    <Box sx={{ display: 'flex', flexDirection: 'column', gap: 3, p: 3 }}>
      <Typography variant="h4" gutterBottom>
        File Transfer
      </Typography>

      {error && (
        <Alert severity="error" sx={{ width: '100%' }}>
          {error}
        </Alert>
      )}

      <Card>
        <CardContent>
          <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
            <TextField
              label="Device Token"
              value={deviceToken}
              onChange={(e) => setDeviceToken(e.target.value)}
              required
              fullWidth
            />

            <input
              type="file"
              ref={fileInputRef}
              style={{ display: 'none' }}
              onChange={handleFileUpload}
            />

            <Button
              variant="contained"
              startIcon={<UploadIcon />}
              onClick={() => fileInputRef.current?.click()}
              disabled={!deviceToken || uploading}
            >
              Upload File
            </Button>

            {uploading && <LinearProgress />}

            <Box sx={{ display: 'flex', gap: 2, alignItems: 'flex-start' }}>
              <TextField
                label="File Name"
                value={downloadFileName}
                onChange={(e) => setDownloadFileName(e.target.value)}
                fullWidth
              />
              <Button
                variant="contained"
                startIcon={<DownloadIcon />}
                onClick={handleFileDownload}
                disabled={!deviceToken || !downloadFileName}
              >
                Download
              </Button>
            </Box>
          </Box>
        </CardContent>
      </Card>

      <Card>
        <CardContent>
          <Typography variant="h6" gutterBottom>
            Transfer History
          </Typography>
          <List>
            {transferLogs.map((log, index) => (
              <ListItem key={index}>
                <ListItemText
                  primary={
                    <Typography
                      component="span"
                      color={log.status === 'success' ? 'success.main' : 'error.main'}
                    >
                      {log.fileName}
                    </Typography>
                  }
                  secondary={
                    <>
                      {log.type === 'upload' ? 'Uploaded' : 'Downloaded'} at{' '}
                      {log.timestamp.toLocaleTimeString()}
                    </>
                  }
                />
                <ListItemSecondaryAction>
                  <IconButton
                    edge="end"
                    onClick={() =>
                      setTransferLogs((prev) =>
                        prev.filter((item, i) => i !== index)
                      )
                    }
                  >
                    <DeleteIcon />
                  </IconButton>
                </ListItemSecondaryAction>
              </ListItem>
            ))}
          </List>
        </CardContent>
      </Card>
    </Box>
  );
};

export default FileTransfer;
